import React from "react";
import ada from "../../assets/img/extra/ada.png"
import aerodesign from "../../assets/img/extra/aerodesign.png"
import baja from "../../assets/img/extra/baja.png"
import caaso from "../../assets/img/extra/caaso.png"
import campanha from "../../assets/img/extra/campanha.png"
import eescjr from "../../assets/img/extra/eescjr.png"
import efestus from "../../assets/img/extra/efestus.png"
import enactus from "../../assets/img/extra/enactus.png"
import fellowship from "../../assets/img/extra/fellowship.png"
import formula from "../../assets/img/extra/formula.png"
import ganesh from "../../assets/img/extra/ganesh.png"
import gaperia from "../../assets/img/extra/gaperia.png"
import ieee from "../../assets/img/extra/ieee.png"
import iteam from "../../assets/img/extra/iteam.png"
import liga from "../../assets/img/extra/liga.png"
import mercado from "../../assets/img/extra/mercado.png"
import mileage from "../../assets/img/extra/mileage.png"
import semear from "../../assets/img/extra/semear.png"
import semente from "../../assets/img/extra/semente.png"
import topus from "../../assets/img/extra/topus.png"
import tupa from "../../assets/img/extra/tupa.png"
import warthog from "../../assets/img/extra/warthog.png"
import wit from "../../assets/img/extra/wit.png"
import yanagi from "../../assets/img/extra/yanagi.png"
import zenith from "../../assets/img/extra/zenith.png"
import {ColLeft, VendasImg} from "./styles";

interface Props{
    url:string;
}

const CardExtras:React.FC<Props> = ({url})=>{
    let img;
    if(url == "ada"){
        img = ada;
    }
    else if(url == "aerodesign"){
        img = aerodesign;
    }
    else if(url == "baja"){
        img = baja;
    }
    else if(url == "caaso"){
        img = caaso;
    }
    else if(url == "campanha"){
        img = campanha;
    }
    else if(url == "eescjr"){
        img = eescjr;
    }
    else if(url == "efestus"){
        img = efestus;
    }
    else if(url == "enactus"){
        img = enactus;
    }
    else if(url == "fellowship"){
        img = fellowship;
    }
    else if(url == "formula"){
        img = formula;
    }
    else if(url == "ganesh"){
        img = ganesh;
    }
    else if(url == "gaperia"){
        img = gaperia;
    }
    else if(url == "ieee"){
        img = ieee;
    }
    else if(url == "iteam"){
        img = iteam;
    }
    else if(url == "liga"){
        img = liga;
    }
    else if(url == "mercado"){
        img = mercado;
    }
    else if(url == "mileage"){
        img = mileage;
    }
    else if(url == "semear"){
        img = semear;
    }
    else if(url == "semente"){
        img = semente;
    }
    else if(url == "topus"){
        img = topus;
    }
    else if(url == "tupa"){
        img = tupa;
    }
    else if(url == "warthog"){
        img = warthog;
    }
    else if(url == "wit"){
        img = wit;
    }
    else if(url == "yanagi"){
        img = yanagi;
    }
    else if(url == "zenith"){
        img = zenith;
    }
    return(
        <ColLeft>
        <VendasImg style={{backgroundImage: `url("${img}")` }}/>
        </ColLeft>
    )
}
export default CardExtras;
